import React, { 
  Component 
} 
from 'react';

import {
  Button,
  Grid,
  Row,
  Column
}
from "./components/boostrap";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Grid>
          <Row>
            <Column>
              <Button name="a"/>
            </Column>
          </Row>
        </Grid>
      </div>
    );
  }
}

export default App;
